The basic idea is that you call Surface::compatibility to get information about what sort of SwapchainConfig you're allowed to build, and then you call Device::create_swapchain with your Surface and the config you want. This gives you a Swapchain, which has methods for controlling the GPU's swapchain, as well as a Backbuffer , which holds the handles to particular Image data. We use an Image to make an ImageView, and we use that to make a Framebuffer, and that's what we're manipulating with the CommandBuffer. So what SwapchainConfig do we try to build? Well, the best one we can. Unfortunately, this varies by quite a bit. Even if I just switch from the Vulkan backend to the DX12 backend on a single machine the system ends up giving me different compatibility results. The SwapchainConfig type does have a from_caps method to try and help you build a value, but it's shockingly error prone, because not all of the capabilities of your Surface are actually contained in the SurfaceCapabilities struct! The Surface::compatibility also gives you Format, PresentMode, and CompositeAlpha that you have to pay attention to, which from_caps totally ignores. We're not going to use that, we'll just write out a struct literal ourselves. SwapchainConfig looks like this: pub struct SwapchainConfig { pub present_mode: PresentMode, pub composite_alpha: CompositeAlpha, pub format: Format, pub extent: Extent2D, pub image_count: SwapImageIndex, pub image_layers: Layer, pub image_usage: Usage,
} present_mode : PresentMode gives us access to that sweet, sweet Vsync. Well, if it's available. We would most like to have Mailbox , which lets us do "triple buffering". That's where you have at least 3 images, and one is "being shown" and then you render frames as quick as you can to different swapchain slots, always keeping the most recent complete frame ready. This gives the least amount of latency between user input and what they see on the screen. We would accept Fifo , where frames are shown in the exact order that they're created. If you do this with 2 images you can have "double buffering" (where you show one frame and work on the next), but if you're using this with more than two images then it causes excess latency between input and display. We would begrudgingly accept Relaxed if we had to use it, which "usually" has vsync but not always. I suppose this is for low-end machines. We want to avoid this if we can. We would hate to have to use Immediate , where there's no vsync at all. That would just be terrible. We could live with it, but it'd be terrible because we'd have to sync the program ourselves to avoid eating up 100% of the core (and all of the user's battery, if they're on a mobile device). composite_alpha : CompositeAlpha controls how your window interacts with other windows within the user's UI. For now we'd prefer Opaque , so that we just show our window "normally". We'd also accept Native , because we trust the user to have set things up how they want. PreMultiplied or PostMultiplied will almost certainly give "wrong" results because our graphics aren't smart enough to compensate for being forced into such a mode. Well, they'd be wrong if our graphics were anything more than a single clear color, but you know what I mean. format : The Format of the swapchain is how the data for each pixel is expected to exist in memory. Normally we'd be a lot more interested, but since we're just clearing the screen it doesn't super matter. Still, we'll try to pick an sRGB format (which stands for "standard Red Green Blue"), just because that's what we'll be using in basically all the future lessons. Here we've got an Option<Vec<_>> , which means that the selection block will be silly and fiddly. extent : The Extent2D describes a full sized rectangle (not a sub-rectangle), and selects a size for our images. Here's where we start using the SurfaceCapabilities that we got earlier. The SwapchainConfig extent that we use must be within the range that the extents: Range<Extent2D> field in our SurfaceCapabilities specifies. Note that the Range type is semantically supposed to be exclusive but both the Vulkan and DX12 backends use it wrong, so it's actually an inclusive value here. As far as what extent we're actually going to pick, we'll go as big as we can. The Surface should should end up being the size of our Window, so our images are just "normal" size and it all works out. image_count : The SwapImageIndex is just a u32 for how many images we want in our Swapchain. Like I said, if we're going to be using Mailbox then we want 3, otherwise we'll go with 2. Note that we have to respect the image_count: Range<SwapImageIndex> field of the SurfaceCapabilities, which is another field that is a Range but should actually be a RangeInclusive. image_layers : The Layer is just a u16 for how many layers we want in our image. 1 is fine. image_usage : The Usage defines how we'll be using the images in the swap chain in terms of the render pass stuff. We'll be using just color for now, so we check for that. With that all done, we make the SwapchainConfig and then we use the Device to build a Swapchain and Backbuffer pair. This is a very vertical portion of code, but not too much is actually happening. let (swapchain, extent, backbuffer, format, frames_in_flight) = { let (caps, preferred_formats, present_modes, composite_alphas) = surface.compatibility(&adapter.physical_device); info!("{:?}", caps); info!("Preferred Formats: {:?}", preferred_formats); info!("Present Modes: {:?}", present_modes); info!("Composite Alphas: {:?}", composite_alphas); // let present_mode = { use gfx_hal::window::PresentMode::*; [Mailbox, Fifo, Relaxed, Immediate] .iter() .cloned() .find(|pm| present_modes.contains(pm)) .ok_or("No PresentMode values specified!")? }; let composite_alpha = { use gfx_hal::window::CompositeAlpha::*; [Opaque, Inherit, PreMultiplied, PostMultiplied] .iter() .cloned() .find(|ca| composite_alphas.contains(ca)) .ok_or("No CompositeAlpha values specified!")? }; let format = match preferred_formats { None => Format::Rgba8Srgb, Some(formats) => match formats .iter() .find(|format| format.base_format().1 == ChannelType::Srgb) .cloned() { Some(srgb_format) => srgb_format, None => formats.get(0).cloned().ok_or("Preferred format list was empty!")?, }, }; let extent = caps.extents.end; let image_count = if present_mode == PresentMode::Mailbox { (caps.image_count.end - 1).min(3) } else { (caps.image_count.end - 1).min(2) }; let image_layers = 1; let image_usage = if caps.usage.contains(Usage::COLOR_ATTACHMENT) { Usage::COLOR_ATTACHMENT } else { Err("The Surface isn't capable of supporting color!")? }; let swapchain_config = SwapchainConfig { present_mode, composite_alpha, format, extent, image_count, image_layers, image_usage, }; info!("{:?}", swapchain_config); // let (swapchain, backbuffer) = unsafe { device .create_swapchain(&mut surface, swapchain_config, None) .map_err(|_| "Failed to create the swapchain!")? }; (swapchain, extent, backbuffer, format, image_count as usize)
}; render_area This is a Rect version of our Extent2D. While an Extent2D is semantically the full area of an image or texture (storing only width: u32 and height: u32 ), a Rect is some sub-portion of such an area (storing x,y,w,h, all i16 ). Note that your sub-portion can totally just be "all of it". frames_in_flight This is just us storing how many images are in our Swapchain. As you saw when we cleared the screen, we'll have one set of just about everything per frame in flight.

