pub struct UserInput { pub end_requested: bool, pub new_frame_size: Option<(f64, f64)>, pub new_mouse_position: Option<(f64, f64)>,
}
impl UserInput { pub fn poll_events_loop(events_loop: &mut EventsLoop) -> Self { let mut output = UserInput::default(); events_loop.poll_events(|event| match event { Event::WindowEvent { event: WindowEvent::CloseRequested, .. } => output.end_requested = true, Event::WindowEvent { event: WindowEvent::Resized(logical), .. } => { output.new_frame_size = Some((logical.width, logical.height)); } Event::WindowEvent { event: WindowEvent::CursorMoved { position, .. }, .. } => { output.new_mouse_position = Some((position.x, position.y)); } _ => (), }); output }
}

